INSERT INTO `destination` VALUES (1,'Aalborg','Denmark','Danish','An ancient city where Viking ships once sailed past on the Limfjord, Aalborg has evolved to a vibrant cultural hotspot with a spectacular waterfront of iconic architectural buildings.'),(2,'Aarhus','Denmark','Danish','Founded in the early Viking Age, Aarhus is one of the oldest cities in Denmark, along with Ribe and Hedeby. The original Aros settlement was situated on the northern shores of a fjord by the mouth of the Aarhus River, right where the city center is today.'),(3,'Aberdeen','Scotland','English','Aberdeen is a port city in northeast Scotland, where the Dee and Don rivers meet the North Sea. With an offshore petroleum industry, the city is home to an international population. It\'s also known as the ‘Granite City’ for its many enduring grey-stone buildings. The 19th-century Marischal College is typical – a monumental Victorian landmark that’s now headquarters of the City Council. '),(4,'Adinkerke','Belgium','Dutch','Adinkerke a small town in western Belgium close to the French border. It is a conurbation with the coastal town of De Panne which in turn is part of the west Belgian coastal conurbation. Adinkerke railway station is also the Western terminus of the Belgian coast tram line to De Panne; Nieuwpoort, Ostend and beyond. '),(5,'Albacete','Spain','Spanish','Albacete is the driest interior province of the Iberian Peninsula, with about 14 inches (350 mm) average annual rainfall. The south is mountainous or hilly and is crossed by the Júcar and Segura rivers, which are the chief local sources of power and water for irrigation.'),(6,'Alentejo','Portugal','Portuguese ','The Alentejo, a region in southern Portugal, covers a huge area of around a third of the country, stretching south from the Rio Tejo to the northern mountain ranges of the Algarve. The name, Alentejo, derives from the words além do Tejo, beyond the Tejo River. This is Portugal’s garden, the bulk of the region given over to huge cork plantations, wheat fields, and vineyards – and though much of it is flat, the region repays exploration, offering unexpected surprises, from ancient dolmens and superbly sited castles to Roman ruins and sweeping Atlantic beaches.'),(7,'Amsterdam','Netherlands','Dutch','Amsterdam, city and port, western Netherlands, located on the IJsselmeer and connected to the North Sea. It is the capital and the principal commercial and financial centre of the Netherlands.'),(8,'Antwerp','Belgium','Dutch','With a population of 530,504, it is the most populous municipality in Belgium, and with a metropolitan population of around 1,200,000 people, it is the second-largest metropolitan region in Belgium, second only to Brussels. Antwerp is on the river Scheldt, linked to the North Sea by the river\'s Westerschelde estuary.'),(9,'Argos','Greece','Greek','Argos is a city in Argolis, Peloponnese, Greece and is one of the oldest continuously inhabited cities in the world, and the oldest in Europe. It is the largest city in Argolis and a major center for the area.'),(10,'Asturias','Spain','Asturian ','Asturias was an independent Christian kingdom between 718 and 910, formed by Visigothic nobles and officials who had been displaced by the Muslim invasion of Spain. '),(11,'Athens','Greece','Greek','One of the most ancient cities in the world, Athens Greece is famous as the birthplace of democracy. With a history of over 3,000 years, Athens is the best town for sightseeing. According to the myth, the city took its name after Athena, the Goddess of Wisdom and daughter of Zeus.'),(12,'Aveleda','Portugal','Portuguese','A versatile and typically Portuguese white wine, which you will enjoy drinking in summer for its great freshness and beautiful minerality. A blend of four Portuguese grape varieties, this wine is made from Arinto, Loureiro, Trajadura and Fernão Pires.'),(13,'Ayia Napa','Cyprus','Greek','Ayia Napa was a small fishing village which in 1994 was declared as a Municipality and it is today one of the best tourist destinations worldwide, very well known as a cosmopolitan resort. Ayia Napa is located in the eastern coast of Cyprus very closed to Famagusta City.'),(14,'Badajoz','Spain','Spanish','Badajoz is the capital of the Province of Badajoz in the autonomous community of Extremadura, Spain. It is situated close to the Portuguese border, on the left bank of the river Guadiana. The population in 2011 was 151,565.'),(15,'Baden-Württemberg','Germany','German','Baden-Württemberg commonly shortened to BW or BaWü, is a German state (Land ) in Southwest Germany, east of the Rhine, which forms the southern part of Germany\'s western border with France.'),(16,'Bahar Ic-Caghaq','Malta','Maltese ','Bahar Ic-Caghaq is an urban village in Malta situated between the limits of Madliena, Magħtab, Għargħur and Pembroke. The area is situated at the mouth of the island\'s longest valley called \'Wied il-Kbir\'.  The name Bahar Ic-Caghaq in Maltese can be translated to the meaning \'sea of pebbles\' in English.'),(17,'Barcelona','Spain','Catalan','Barcelona is the capital city of Catalonia, which is a region of Spain. Barcelona is the largest city on the Mediterranean coast. The city is between the rivers of Llobregat and Besòs, and south of the Pyrenees mountains. It has a humid subtropical climate (Cfa in the Köppen climate classification). If there were only three words to describe Barcelona city centre they would be Culture, Style and Harmony. The city of Barcelona manages to cater for the demands of the modern World whilst ensuring that the new blends perfectly with the old.'),(18,'Berlin','Germany','German','Berlin, the capital city of Germany, is renowned for its exceptional range of landmarks, vibrant cultural scene and way of life that\'s somehow all go yet relaxed. In fact, the city is best known for its striking contrasts. Historical buildings stand alongside modern architecture as the past and present intermingle.'),(19,'Bestwig','Germany','German','Bestwig is a municipality in the Hochsauerland district, in North Rhine-Westphalia, Germany.== Geography ==Bestwig is situated on the river Ruhr, approx. 10 km east of Meschede.\r'),(20,'Billund','Denmark','Danish ','Billund  is a town in Jutland, Denmark. It is the home of the Lego Group head office. It is also the site of a theme park, Legoland, waterpark resort, Lalandia, and Billund Airport which is the second largest airport in Denmark.\r'),(21,'Bitburg','Germany','German','Bitburg is a small German city in Rhineland-Palatinate known for its beer, beautiful natural scenery, and annual European folk festival.'),(23,'Bohemia','Czech Republic','Czech','Bohemia is a historical country that was part of Czechoslovakia from 1918 to 1939 and from 1945 to 1992. Since 1993 Bohemia has formed much of the Czech Republic, comprising the central and western portions of the country.'),(24,'Bologna','Italy','Italian','Bologna is the lively, historic capital of the Emilia-Romagna region, in northern Italy. Its Piazza Maggiore is a sprawling plaza lined with arched colonnades, cafes and medieval and Renaissance structures such as City Hall, the Fountain of Neptune and the Basilica di San Petronio. Among the city’s many medieval towers are the Two Towers, leaning Asinelli and Garisenda'),(25,'Branton','United Kingdom','English','Located in South Yorkshire, United Kingdom, Branton is home to an impressive selection of attractions and experiences, making it well worth a visit.'),(26,'Brugelette','Belgium','Dutch','Brugelette  is a municipality of Wallonia located in the province of Hainaut, Belgium.On January 1, 2006, Brugelette had a total population of 3,284. The total area is 28.40 km2 (10.97 sq mi) which gives a population density of 116 inhabitants per square kilometre (300/sq mi).'),(27,'Budapest','Hungary','Hungarian','Budapest   is the capital and most populous city of Hungary. It is the ninth-largest city in the European Union by population within city limits and the second-largest city on the Danube river; the city has an estimated population of 1,752,286 over a land area of about 525 square kilometres (203 square miles). Budapest, which is both a city and county, forms the centre of the Budapest metropolitan area, which has an area of 7,626 square kilometres (2,944 square miles) and a population of 3,303,786; it is a primate city, constituting 33% of the population of Hungary.The history of Budapest began when an early Celtic settlement transformed into the Roman town of Aquincum, the capital of Lower Pannonia.'),(28,'Bunratty','Ireland','Irish','Bunratty is a village in County Clare, Ireland, near Bunratty Castle. It is connected by the N18 road to Limerick and Galway. The Raite river defines the parish\'s eastern boundary and flows into the Shannon Estuary, which defines the southern boundary.'),(29,'Bussolengo','Italy','Italian','Bussolengo is an Italian town of 19,574 inhabitants on the Adige River in province of Verona, Veneto. One of its oldest churches is the frescoed church of San Valentino.== Geography ==Bussolengo borders with the municipalities of Castelnuovo del Garda, Lazise, Pastrengo, Pescantina, Sona and Verona.'),(30,'Cambridge','United Kingdom','English','Cambridge  is a university city and the county town in Cambridgeshire, England. It is located on the River Cam approximately 55 miles (89 km) north of London. As of the 2021 United Kingdom census, the population of Cambridge was 145,700.'),(31,'Capri Island','Italy','Italian','Capri, an island in Italy’s Bay of Naples, is famed for its rugged landscape, upscale hotels and shopping, from designer fashions to limoncello and handmade leather sandals. One of its best-known natural sites is the Blue Grotto, a dark cavern where the sea glows electric blue, the result of sunlight passing through an underwater cave. In summer, Capri\'s dramatic, cove-studded coastline draws many yachts. '),(32,'Carinthia','Austria','German','Carinthia  is the southernmost Austrian state, in the Eastern Alps, and is noted for its mountains and lakes. The main language is German. Its regional dialects belong to the Southern Bavarian group.'),(33,'Carrochan','Scotland','English','The new building, “Carrochan”, provides a central headquarters for the first National Park in Scotland that covers a region over 700 square miles north and west of Balloch. The new building provides flexible workspace for over 120 staff, associated community groups, staff from Scottish Natural Heritage and SEPA.'),(34,'Castelnuovo del Garda','Italy','Italian','Castelnuovo del Garda is an Italian comune (municipality), in the Province of Verona, in Veneto, on a couple of morainic hills few kilometers south-east from Lake Garda. Verona is about 20 km to the east, Venice is 140 km east and Milan 140 km west.Castelnuovo del Garda has a short beach on the lake, between the municipalities of Peschiera del Garda and Lazise.'),(36,'Ceské Budejovice','Czech Republic','Czech','České Budějovice  is a city in the South Bohemian Region of the Czech Republic. It has about 93,000 inhabitants. It is located in the valley of the Vltava River, at its confluence with the Malše.'),(37,'Chania','Greece','Greek','Chania (also spelled: Hania) is the capital city, a place where different civilizations have flourished throughout the centuries. Strolling around the Old Town\'s maze-like alleys with the beautiful Venetian mansions, the fountains and the churches will guide you through well-preserved historical monuments.'),(38,'Cleebronn','Germany','German','Cleebronn  is a municipality in the district of Heilbronn in Baden-Württemberg in southern  Germany. Cleebronn is in the Zabergäu in the south of the district of Heilbronn, directly in the north of the Stromberg mountain with an elevation of 220 to 260 metres (720 to 850 ft). The landscape is characterised by wine-growing.'),(39,'Coimbra','Portugal','Portuguese','Coimbra  is a city and a municipality in Portugal. The population of the municipality at the 2011 census was 143,397, in an area of 319.40 square kilometres (123.3 sq mi).The fourth-largest  agglomerated urban area in Portugal after Lisbon, Porto, and Braga, it is the largest city of the district of Coimbra and the Centro Region.'),(40,'Como','Italy','Italian','Lake Como is a stunning destination for travelers who are looking to relax among scenic beauty. This lake offers plenty of time for fun with beaches that often come with beach clubs offering additional features. The lake is notably deep as well, with depths of up to 448 yards at its deepest point, making it one of the deepest in all of Europe.'),(41,'Copenhagen','Denmark','Danish ','Copenhagen  is the capital and most populous city of Denmark, with a population of around 1.4 million in the urban area, and more than 2 million in the wider Copenhagen metropolitan area. The city is on the islands of Zealand and Amager, separated from Malmö, Sweden, by the Øresund strait. The Øresund Bridge connects the two cities by rail and road.'),(42,'Córdoba','Spain','Spanish','Córdoba remains a typically Moorish city with narrow, winding streets, especially in the older quarter of the centre and, farther west, the Judería (Jewish quarter). A Moorish bridge with 16 arches on Roman bases connects Córdoba with its suburbs across the river.'),(43,'Corfu','Greece','Greek','Corfu  is a Greek island in the Ionian Sea, of the Ionian Islands, and, including its small satellite islands, forms the margin of the northwestern frontier of Greece. The island is part of the Corfu regional unit, and is administered by three municipalities with the islands of Othonoi, Ereikoussa, and Mathraki. The principal city of the island (pop.'),(44,'Corinth','Greece','Greek','Corinth  is the successor to an ancient city, and is a former municipality in Corinthia, Peloponnese, which is located in south-central Greece. Since the 2011 local government reform, it has been part of the municipality of Corinth, of which it is the seat and a municipal unit. It is the capital of Corinthia.\''),(45,'Zagreb','Ireland','Irish','County Kerry, in the peninsular southwest region of Ireland, is known for its pockets of Irish-language speakers and striking terrain. Passing rugged coastline and mountains, the Ring of Kerry is a popular scenic driving route skirting the edges of the Iveragh Peninsula. Within Killarney National Park’s 10,000-hectare limits are trails through forests, moorland and to landmarks like Torc Waterfall and Torc Mountain. '),(46,'Delbrück','Germany','German','Delbrück is a town in the east of North Rhine-Westphalia, Germany, located in the district Paderborn.== History ==The first document mentioning the town dates to 1219. In 1410, the town was destroyed by fire during a conflict between the bishop of Paderborn and the bishop of Cologne.'),(47,'Delphi','Greece','Greek','Delphi is famous for one thing in particular: it is home to the world-famous oracle of Delphi. This oracle was renowned in Ancient Greece, as pilgrims from all over the Mediterranean would visit it to receive the prophecies of the ancient Greek god Apollo.'),(49,'Dvur Kralove nad Labem','Czech Republic','Czech','Dvůr Králové nad Labem  is a town in Trutnov District in the Hradec Králové Region of the Czech Republic. It has about 15,000 inhabitants. It lies in the Elbe river valley.'),(51,'Eastern Bohemia','Czech Republic','Czech','Bohemia is a historical country that was part of Czechoslovakia from 1918 to 1939 and from 1945 to 1992. Since 1993 Bohemia has formed much of the Czech Republic, comprising the central and western portions of the country.'),(52,'Echternach','Luxembourg','Luxembourgish ','Echternach is a commune with town status in the canton of Echternach, which is part of the district of Grevenmacher, in eastern Luxembourg. Echternach lies near the border with Germany, and is the oldest town in Luxembourg.== History ==The town grew around the Abbey of Echternach, which was founded in  698  by St Willibrord, an English monk from Ripon, Northumbria (in present-day North Yorkshire, England), who became the first bishop of Utrecht and worked to Christianize the Frisians.'),(53,'Edinburgh','Scotland','English','Edinburgh is not only one of the most beautiful cities in Europe, it is a city with a fantastic position. The view falls on all sides – green hills, the hint of the blue sea, the silhouettes of the buildings and the red cliffs. It is a city that calls you to explore it by foot – narrow streets, passageways, stairs and hidden church yards on every step will pull you away from the main streets.'),(57,'Genoa','France','French','Geneva  is the second-most populous city in Switzerland (after Zürich) and the most populous city of Romandy, the French-speaking part of Switzerland. Situated in the south west of the country, where the Rhône exits Lake Geneva, it is the capital of the Republic and Canton of Geneva.The city of Geneva (ville de Genève) had a population of 203,951 in 2020 (Jan.'),(58,'Glasgow','United Kingdom','English','Glasgow is one of Europe\'s most vibrant and cosmopolitan cities. It boasts world famous art collections, the best shopping in the UK outside of London, first-class sports and leisure facilities, a vast array of restaurants and bars, and the most vibrant and exciting nightlife in Scotland.'),(59,'Gran Canaria','Spain','Spanish','Gran Canaria   also Grand Canary Island, is the third-largest and second-most-populous island of the Canary Islands, an archipelago off the Atlantic coast of Northwest Africa which is part of Spain. As of 2019 the island had a population of 851,231 that constitutes approximately 40% of the population of the archipelago.Las Palmas de Gran Canaria, the capital of the island, is the biggest city of the Canary Islands and the ninth of Spain.'),(60,'Guimarães',' as well as the historical Minho Province.\"','Portugal','Guimarães   is a city and municipality located in northern Portugal, in the district of Braga. Its historic town centre has been listed as a UNESCO World Heritage Site since 2001, in recognition for being anexceptionally well-preserved and authentic example of the evolution of a medieval settlement into a modern town\" in Europe.Guimarães is also a part of the Ave Subregion (one of the most industrialised subregions in the country)'),(61,'Ħal Far','Malta','Maltese ','Ħal Far is the largest industrial estate in Malta. It is at the southern extreme of Malta, between the localities of Birżebbuġa, Safi and Żurrieq.In the past, Ħal Far housed the RAF Hal Far airfield, which was known as HMS Falcon when in the service of the Royal Navy.'),(63,'Heilbronn','Germany','German','Heilbronn   is a city in northern Baden-Württemberg, Germany, surrounded by Heilbronn District. With over 126,000 residents, it is the sixth-largest city in the state.From the late Middle Ages on, it developed into an important trading centre. At the beginning of the 19th century, Heilbronn became one of the centres of early industrialisation in Württemberg.'),(65,'Heraklion','Greece','Greek','Heraklion or Iraklion is the largest city and the administrative capital of the island of Crete and capital of Heraklion regional unit. It is the fourth largest city in Greece with a population of 211,370 (Urban Area) according to the 2011 census. The population of the municipality was 177,064.The Bronze Age palace of Knossos, also known as the Palace of Minos, is located 5.5 km (3.1m) southeast of the city.'),(66,'Herne','Germany','German','Herne is a city in North Rhine-Westphalia, Germany. It is located in the Ruhr area directly between the cities of Bochum and Gelsenkirchen.'),(67,'Innsbruck','Austria','German','Innsbruck    is the capital of Tyrol and the fifth-largest city in Austria. On the River Inn, at its junction with the Wipp Valley, which provides access to the Brenner Pass 30 km (18.6 mi) to the south, it had a population of 132,493 in 2018.In the broad valley between high mountains, the so-called North Chain in the Karwendel Alps (Hafelekarspitze, 2,334 metres or 7,657 feet) to the north and Patscherkofel (2,246 m or 7,369 ft) and Serles (2,718 m or 8,917 ft) to the south, Innsbruck is an internationally renowned winter sports centre; it hosted the 1964 and 1976 Winter Olympics as well as the 1984 and 1988 Winter Paralympics.'),(68,'Inverness','Scotland','English','Inverness is a city on Scotland’s northeast coast, where the River Ness meets the Moray Firth. It\'s the largest city and the cultural capital of the Scottish Highlands. Its Old Town features 19th-century Inverness Cathedral, the mostly 18th-century Old High Church and an indoor Victorian Market selling food, clothing and crafts. The contemporary Inverness Museum and Art Gallery traces local and Highland history.'),(69,'Kaisersbach','Germany','German','Kaisersbach is a municipality in the district of Rems-Murr in Baden-Württemberg in Germany. Visti Schwabenpark, an amusement park in Gmeinweiler village, which belongs to Kaiserbach.'),(70,'Kalambaka','Greece','Greek','Kalabaka   is a town and seat of the municipality of Meteora in the Trikala regional unit, part of Thessaly in Greece. The population was 12,000 at the 2011 census, of which 8,330 in the town proper. The Meteora monasteries are located near the town.'),(71,'Kappel-Grafenhausen','Germany','German','Kappel-Grafenhausen  üsä) is a town in the district of Ortenau in Baden-Württemberg in Germany.'),(72,'Karlovy Vary','Czech Republic','Czech','Karlovy Vary ish) is a spa city in the Karlovy Vary Region of the Czech Republic. It has about 46,000 inhabitants. It lies on the confluence of the rivers Ohře and Teplá.'),(73,'Kutná Hora','Czech Republic','Czech','Kutná Hora   is a town in the Central Bohemian Region of the Czech Republic. It has about 20,000 inhabitants. The centre of Kutná Hora, including the Sedlec Abbey and its ossuary, was designated a UNESCO World Heritage Site in 1995 because of its outstanding architecture and its influence on subsequent architectural developments in other Central European city centres.'),(74,'Lazise','Italy','Italian','Lazise is a comune (municipality) and town in the Province of Verona in the Italian region Veneto, located about 120 kilometres (75 miles) west of Venice and about 20 kilometres (12 miles) northwest of Verona. It is situated on the eastern shore of Lake Garda. As of 31 December 2004, it had a population of 6,213 and an area of 65.0 square kilometres (25.1 sq mi).'),(75,'Lichtaart','Belgium','Dutch','Lichtaart is a village in Belgium, in the province of Antwerp and municipality of Kasterlee. The village is situated near the town, Antwerp. Lichtaart bordered by the Rivers, Nete and Kaliebeek.'),(76,'Limassol','Cyprus','Greek','Limassol   is a city on the southern coast of Cyprus and capital of the district with the same name. Limassol is the second largest urban area in Cyprus after Nicosia, with an urban population of 183,658 and a metropolitan population of 239,842.In 2014, Limassol was ranked by TripAdvisor as the 3rd up-and-coming destination in the world, in its Top 10 Traveler\\\'s Choice Destinations on the Rise list. The city is also ranked 89th worldwide in Mercer\\\'s Quality of Living Survey (2017).In the 2020 ranking published by the Globalization and World Cities Research Network, Limassol was classified as aGamma −\" global city.\"'),(80,'Löffingen','Germany','German','Löffingen is a town in the district Breisgau-Hochschwarzwald, in Baden-Württemberg, Germany. It is situated 14 km southwest of Donaueschingen, and 40 km southeast of Freiburg.'),(81,'Lombardy','Italy','Italian','Lombardy is a region in Northern Italy. Its capital, Milan, is a global hub of fashion and finance, with many high-end shops and restaurants. Its Gothic Duomo di Milano cathedral and Santa Maria delle Grazie convent, housing Leonardo da Vinci’s painting of “The Last Supper,” testify to centuries of art and culture. North of Milan, Lake Como is an upscale alpine resort with dramatic scenery.'),(82,'London','United Kingdom','English','London has been the most visited city in Europe for multiple years — in fact, London is one of the most visited cities in the world. London has multiple major airports so flights to/from London are plentiful and they tend to have the lowest ticket prices. London is great for first-time travelers because there is no language barrier so it’s a nice way to ease into visiting a foreign country. Finally, London is simply an amazing world-class city with so much to do, see, and eat. You can easily spend a week or more here and never run out of things to experience.'),(84,'Madrid','Spain','Spanish ','Madrid   is the capital and most populous city of Spain. The city has almost 3.4 million inhabitants and a metropolitan area population of approximately 6.7 million. It is the second-largest city in the European Union (EU), and its monocentric metropolitan area is the second-largest in the EU. The municipality covers 604.3 km2 (233.3 sq mi) geographical area.Madrid lies on the River Manzanares in the central part of the Iberian Peninsula.'),(86,'Malmö','Sweden','Swedish','Malmö  is the largest city in the Swedish county (län) of Scania (Skåne). It is the third-largest city in Sweden, after Stockholm and Gothenburg, and the sixth-largest city in the Nordic region, with a municipal population of 357,377 in 2022. The Malmö Metropolitan Region is home to over 700,000 people, and the Øresund Region, which includes Malmö and Copenhagen, is home to 4 million people.Malmö was one of the earliest and most industrialised towns in Scandinavia, but it struggled to adapt to post-industrialism.'),(87,'Mechelen','Belgium','Mechlinian ','It was heavily damaged in World Wars I and II. Long renowned for lacemaking, Mechelen is also one of western Europe\'s principal vegetable markets and has railway repair shops. Its industries include brewing, the manufacture of furniture and textiles, and various handicrafts, in particular tapestry making.'),(88,'Meckenbeuren','Germany','German','Meckenbeuren is a municipality in the Bodensee district, in Baden-Württemberg, Southern Germany. It is located 10 kilometres (6 miles) south of Ravensburg, and 8 kilometres (5 miles) northeast of Friedrichshafen, on Lake Constance.== Geography ===== Location ===Meckenbeuren is located about eight kilometres north of Friedrichshafen and ten kilometres south of Ravensburg in the lower Schussental valley near Lake Constance.'),(89,'Mellieħa','Malta','Maltese ','Mellieħa   is a large village in the Northern Region of Malta. It has a population of 10,087 as of March 2014. Mellieħa is also a tourist resort, popular for its sandy beaches, natural environment, and Popeye Village nearby.'),(91,'Milan','Italy','Italian','Milan is the capital city of the region of Lombardy in northern Italy. It is the second largest city by population in Italy, behind Rome with excellent underground system to get around. It is Italy\'s leading financial centre and its most prosperous manufacturing and commercial city.Buildings range from the Renaissance-style Santa Maria delle Grazie church (which has a fun optical illusion and is designated a Unesco World Heritage Site) to the 19th-century shopping plaza, the Galleria Vittorio Emanuele II. There are also art-nouveau townhouses with geometric stained-glass windows, detailed floral motifs and ornate metalwork in Porta Venezia, as well as the sweet yellow case di ringhiera, traditional workers’ houses in the Navigli and somewhat scattered throughout the city. .'),(92,'Murcia','Spain','Spanish','Murcia  is a city in south-eastern Spain, the capital and most populous city of the autonomous community of the Region of Murcia, and the seventh largest city in the country. It had a population of 460,349 inhabitants in 2021 (about one third of the total population of the Region). The total population of the metropolitan area is 672,773 in 2020, covering an urban area of 1,230.9 km2.'),(93,'Nafplio','Greece','Greek','Nafplio   is a coastal city located in the Peloponnese in Greece and it is the capital of the regional unit of Argolis and an important touristic destination. Founded in antiquity, the city became an important seaport in the Middle Ages during the Frankokratia as part of the lordship of Argos and Nauplia, held initially by the de la Roche following the Fourth Crusade before coming under the Republic of Venice and, lastly, the Ottoman Empire. The city was the second capital of the First Hellenic Republic and of the Kingdom of Greece, from 1827 until 1834.'),(94,'Capri','Italy','Italian','Capri, an island in Italy’s Bay of Naples, is famed for its rugged landscape, upscale hotels and shopping, from designer fashions to limoncello and handmade leather sandals. One of its best-known natural sites is the Blue Grotto, a dark cavern where the sea glows electric blue, the result of sunlight passing through an underwater cave. In summer, Capri\'s dramatic, cove-studded coastline draws many yachts. '),(95,'Naples','Italy','Italian','Naples is the regional capital of Campania and the third-largest city of Italy, after Rome and Milan, with a population of 909,048 within the city\'s administrative limits as of 2022.'),(97,'North Zealand','Denmark','Danish','North Zealand, also North Sealand  refers to the northern part of the Danish island of Zealand which is not clearly defined but generally covers the area north of Copenhagen. The Danish tourist authorities have recently introduced the term Danish Riviera to cover the area in view of its increasing importance for tourism. The area has three royal castles and offers resorts with beaches, as well as lakes and forests.'),(98,'Oberried','Germany','German','Oberried is a city in Baden-Wurttemberg, Germany. It has many popular attractions, including Steinwasen Park, Museums-Bergwerk Schauinsland, making it well worth a visit.'),(99,'Ostrava','Czech Republic','Czech','Ostrava  is a city in the north-east of the Czech Republic, and the capital of the Moravian-Silesian Region. It has about 280,000 inhabitants. It lies 15 km (9 mi) from the border with Poland, at the confluences of four rivers: Oder, Opava, Ostravice and Lučina.'),(100,'Pajala','Sweden','Swedish','Pajala  is a locality and the seat of Pajala Municipality in Norrbotten County, Sweden, with 1,958 inhabitants in 2010. It is located in Swedish Lapland.Pajala is in the Torne Valley and was dominated by people speaking a Finnish dialect until Eastern Sweden (Finland) got annexed by Russia in the 1800s and Pajala ended on the Swedish side of the river that marked the border'),(101,'Paris','France','French','Paris is absolutely jam-packed with famous sights, museums, nightlife, and culture. Paris also has an excellent Metro system so getting around is quick and easy. Additionally, Paris also boasts the highest number of vacation rental apartments along with a robust hotel and hostel inventory. Paris is one of the most beautiful cities in the world. It is known worldwide for the Louvre Museum, Notre-Dame cathedral, and the Eiffel tower. It has a reputation of being a romantic and cultural city. The city is also known for its high-quality gastronomy and the terraces of its cafés. '),(102,'Pas-de-Calais','France','French','The Pas-de-Calais  is a department in northern France named after the French designation of the Strait of Dover, which it borders. It has the most communes of all the departments of France, 890, and is the 8th most populous. It had a population of 1,465,278 in 2019.'),(104,'Pindus','Greece','Greek','The Pindus mountain range runs along the border between Epirus and Thessaly, includes two national parks and some of the highest mountain peaks in the country.'),(105,'Pisa','Italy','Italian','Pisa is a city and comune in Tuscany, central Italy, straddling the Arno just before it empties into the Ligurian Sea. It is the capital city of the Province of Pisa. Although Pisa is known worldwide for its leaning tower, the city contains more than twenty other historic churches, several medieval palaces, and bridges across the Arno.'),(106,'Plzen','Czech Republic','Czech','Plzeň  is a city in the Czech Republic. About 90 kilometres (56 miles) west of Prague in western Bohemia, it is the fourth most populous city in the Czech Republic with about 169,000 inhabitants (2022).The city is known worldwide for Pilsner beer, created by Bavarian brewer Josef Groll in the city in 1842.'),(107,'Pompeii','Italy','Italian','Pompeii, a flourishing resort city south of ancient Rome, was nestled along the coast of Italy in the shadow of Mount Vesuvius, an active volcano. Its most famous eruption took place in the year 79 A.D., when it buried the city of Pompeii under a thick carpet of volcanic ash.'),(108,'Pontevedra','Spain','Galician','Pontevedra is a Spanish city in the north-west of the Iberian Peninsula. It is the capital of both the Comarca (County) and Province of Pontevedra, and of the Rías Baixas in Galicia. It is also the capital of its own municipality which is often considered an extension of the actual city.'),(109,'Porto','Portugal','Portuguese ','Located in the north of Portugal by the outlet of the Douro River, it has a unique atmosphere with elegant neighbourhoods and large villas sitting on narrow cobbled streets. This soulful city was classified as a World Heritage Site by UNESCO in 1996. Porto is just the perfect size to explore by foot.'),(110,'Positano','Italy','Italian','Positano is a cliffside village on southern Italy\'s Amalfi Coast. It\'s a well-known holiday destination with a pebble beachfront and steep, narrow streets lined with boutiques and cafes. Its Chiesa di Santa Maria Assunta features a majolica-tiled dome and a 13th-century Byzantine icon of the Virgin Mary. The Sentiero degli Dei hiking trail links Positano to other coastal towns. '),(111,'Prague','Czech Republic','Czech','Prague is the capital and the largest city of the Czech Republic situated in the middle of Bohemia on the Vltava River. It took the city eleven centuries to get the look we know today. Nowadays it covers an area of 496 square kilometres and has about 1 240 000 inhabitants.'),(112,'Pruhonice','Czech Republic','Czech','Located 6 km from Prague is Pruhonice, a lovely small community featuring a gorgeous park complete with a chateau. The Pruhonice Park showcases 250 hectares of landscaped greenery that will surely make you feel that you have entered a fairy tale.'),(113,'Puerto de la Cruz','Spain','Spanish','Puerto de la Cruz is most famous for being one of the first tourism destinations in the world. Located on the north coast of Tenerife Island, Puerto de la Cruz’s warm climate and serene atmosphere attracted the first privileged tourists in the early 19th century.'),(114,'Reichshof Eckenhagen','Germany','German','Reichshof is a North Rhine-Westphalian municipality in the Oberbergischer Kreis in Germany, about 40 km east of Cologne. It is a health resort, known for its good climate.'),(115,'Rhodes','Greece','Greek','Rhodes  is the largest of the Dodecanese islands of Greece and is their historical capital; it is the ninth largest island in the overall Mediterranean Sea. Administratively, the island forms a separate municipality within the Rhodes regional unit, which is part of the South Aegean administrative region. The principal town of the island and seat of the municipality is Rhodes.'),(116,'Rome','Italy','Italian','Rome is the \'Eternal City\', is the capital and largest city of Italy and of the Lazio region. It\'s the famed city of the Roman Empire, the Seven Hills, La Dolce Vita, the Vatican City and Three Coins in the Fountain.'),(118,'Rust','Germany','German','Rust is a municipality in the district of Ortenau in Baden-Württemberg in Germany. It is also the home of the famous theme park Europa-Park'),(119,'Salisbury','United Kingdom','English','Salisbury  is a cathedral city in Wiltshire, England with a population of 41,820, at the confluence of the rivers Avon, Nadder and Bourne. The city is approximately 20 miles (30 kilometres) from Southampton and 30 miles (50 kilometres) from Bath.Salisbury is in the southeast of Wiltshire, near the edge of Salisbury Plain.\r'),(120,'Salou','Spain','Spanish','Salou is located on on Spain\'s Costa Dorada, just south of Barcelona, and has Europe\'s biggest theme park on the doorstep. There\'s a waterpark just up the road, too. The resort sets a lively pace at night, with a big choice of bars and clubs.'),(121,'Salzburg','Austria','German ','Anif is a city in Salzburg, Austria. It has many popular attractions, including Fortress Hohensalzburg, Mirabell Palace, Hellbrunn Castle, making it well worth a visit.'),(122,'Santorini','Greece','Greek','Santorini  officially Thira (Greek: Θήρα Greek pronunciation: [ˈθira]) and classical Greek Thera (English pronunciation ), is an island in the southern Aegean Sea, about 200 km (120 mi) southeast from the Greek mainland. It is the largest island of a small circular archipelago, which bears the same name and is the remnant of a caldera. It forms the southernmost member of the Cyclades group of islands, with an area of approximately 73 km2 (28 sq mi) and a 2011 census population of 15,550.\r'),(123,'Saxony-Anhalt','Germany','German','Saxony-Anhalt  is a state of Germany, bordering the states of Brandenburg, Saxony, Thuringia and Lower Saxony. It covers an area of 20,451.7 square kilometres (7,896.4 sq mi)and has a population of 2.17 million inhabitants, making it the 8th-largest state in Germany by area and the 11th-largest by population. Its capital is Magdeburg and its largest city is Halle (Saale).\r'),(124,'Seville','Spain','Spanish','The city of Seville (or Sevilla in spanish) is the capital of the Spanish region and province of Andalusia and has about 700,000 inhabitants, making Seville the fourth largest city in Spain. In the cultural, political, economic and artistic realms, Seville is the most important southern Spanish city.'),(125,'Shetland Islands','Scotland','English','Shetland, also called the Shetland Islands and formerly Zetland, is a subarctic archipelago in Scotland lying between Orkney, the Faroe Islands, and Norway.'),(126,'Sinsheim','Germany','German','Sinsheim  is a town in south-western Germany, in the Rhine Neckar Area of the state Baden-Württemberg about 22 kilometres (14 mi) south-east of Heidelberg and about 28 kilometres (17 mi) north-west of Heilbronn in the district Rhein-Neckar.== Geography ===== Overview ===Sinsheim consists of a town centre and 12 suburbs with a total population of 35,373 (as of December 2011). Its area encompasses 127 square kilometers (49 sq mi).'),(127,'Soltau','Germany','German','Soltau  is a mid-sized town in the Lüneburg Heath in the district of Heidekreis, in Lower Saxony, Germany. It has around 22,000 inhabitants. The city is centrally located in the Lüneburg Heath and is known nationwide especially for its tourist attractions like the Heide-Park and the Soltau-Therme.\r'),(128,'Sonnenbühl','Germany','German','Sonnenbühl is a municipality in the district of Reutlingen, state of Baden-Württemberg, Germany.Sonnenbühl is a municipality on the plateau of the Swabian Alb, just south of Reutlingen. The seat of the municipality is in the district Undingen.'),(129,'Sottomarina','Italy','Italian','Sottomarina is a small town on a peninsula which has the same name. It is a frazione of the comune of Chioggia, which is part of the Metropolitan City of Venice in the Veneto region in north-eastern Italy. Sottomarina is a peninsula which protrudes into the Lagoon of Venice, forming its southern coastal tract.'),(130,'Soure','Portugal','Portuguese','Soure is a Portuguese village in the District of Coimbra, in the Center region and sub-region of Baixo Mondego, capital of a municipality with 270 km2 and with a population of 20 thousand inhabitants.'),(131,'Spata','Greece','Greek','Sparta was a prominent city-state in Laconia, in ancient Greece. In antiquity, the city-state was known as Lacedaemon (Λακεδαίμων, Lakedaímōn), while the name Sparta referred to its main settlement on the banks of the Eurotas River in Laconia, in south-eastern Peloponnese. Around 650 BC, it rose to become the dominant military land-power in ancient Greece.'),(132,'St. Pölten','Austria','German','Sankt Pölten  , mostly abbreviated to the official name St. Pölten, is the capital and largest city of the State of Lower Austria in northeast Austria, with 55,538 inhabitants as of 1 January 2020.'),(133,'Stukenbrock','Germany','German','Stukenbrock is a city in the district of Gütersloh in the state of North Rhine-Westphalia, Germany. It is located near the Eggegebirge, approx. 15 km east of Gütersloh and 15 km south-east of Bielefeld.'),(134,'Stuttgart','Germany','German','Stuttgart   is the capital and largest city of the German state of Baden-Württemberg. It is located on the Neckar river in a fertile valley known as the Stuttgarter Kessel (Stuttgart Cauldron) and lies an hour from the Swabian Jura and the Black Forest. Stuttgart has a population of 635,911, making it the sixth largest city in Germany.'),(135,'Šumava','Austria','Czech','The Bohemian Forest, known in Czech as Šumava (pronounced [ˈʃumava] (listen)) and in German as Böhmerwald, is a low mountain range in Central Europe. Geographically, the mountains extend from Plzeň Region and South Bohemia in the Czech Republic to Austria and Bavaria in Germany, and form the highest truncated uplands of the Bohemian Massif, up to 50 km wide. They create a natural border between the Czech Republic on one side and Germany and Austria on the other.'),(136,'Tallinn','Estonia','Estonian ','Tallinn   is the capital and most populous city of Estonia. Situated on a bay in north Estonia, on the shore of the Gulf of Finland of the Baltic Sea, Tallinn has a population of about 454,000 (as of 2023) and administratively lies in the Harju maakond (county). Tallinn is the main financial, industrial, and cultural centre of Estonia.'),(137,'Tartu','Estonia','Estonian ','Tartu is the second largest city in Estonia after Tallinn. Tartu has a population of 91,407 (as of 2021). It is 186 kilometres (116 miles) southeast of Tallinn and 245 kilometres (152 miles) northeast of Riga, Latvia.'),(141,'Vatican City','Italy','Italian','Vatican City (Città del Vaticano in Italian) is an independent city state located in the heart of Rome, ruled by the Pope (Bishop of Rome). It is the centre of authority over the Roman Catholic Church. The Vatican is the smallest state in Europe.'),(142,'Venice','Italy','Italian','Venice, known also as the “City of Canals,” “The Floating City,” and “Serenissima,” is arguably one of Italy\'s most picturesque cities. With its winding canals, striking architecture, and beautiful bridges, Venice is a popular destination for travel.'),(143,'Verona','Italy','Italian','Verona is a magical city in northern Italy where art, history and culture combine to give you wonderful memories. Home of Romeo and Juliet, it is known all over the world as a city to fall in love with.'),(146,'Wavre','Belgium','Dutch','Wavre  is a city and municipality of Wallonia, capital of the province of Walloon Brabant, Belgium.Wavre is in the Dyle valley.  Most inhabitants speak French as their mother tongue and are calledWavriens\" andWavriennes\"\".\"'),(147,'Wuppertal','Germany','German','Wuppertal  is, with a population of approximately 355,000, the seventh-largest city in North Rhine-Westphalia as well as the 17th-largest city in Germany.  It was founded in 1929 by the merger of the cities and towns of Elberfeld, Barmen, Ronsdorf, Cronenberg and Vohwinkel, and was initiallyBarmen-Elberfeld\" before adopting its present name in 1930.\"'),(149,'Zákynthos','Greece','Greek','Zakynthos  is a Greek island in the Ionian Sea. It is the third largest of the Ionian Islands. Zakynthos is a separate regional unit of the Ionian Islands region, and its only municipality.'),(151,'Zlin','Austria','German','Linz  is the capital of Upper Austria and third-largest city in Austria. In the north of the country, it is on the Danube 30 km (19 mi), south of the Czech border. In 2018, the population was 204,846.In 2009, it was a European Capital of Culture.\']'),(152,'Myconos','Greece','Greek','Mykonos is an island in the Cyclades group in the Aegean Sea. It\'s popularly known for its summer party atmosphere. Beaches such as Paradise and Super Paradise have bars that blare thumping music. Massive dance clubs attract world-renowned DJs and typically stay open well past dawn. Iconic landmarks include a row of 16th-century windmills, which sit on a hill above Mykonos town. '),(153,'Preveza','Greece','Greek','Preveza is a city in the region of Epirus, northwestern Greece, located on the northern peninsula of the mouth of the Ambracian Gulf. It is the capital of the regional unit of Preveza, which is the southern part of the region of Epirus.'),(154,'Olympia','Greece','Greek','Olympia was the birthplace of the most famous and important sporting event in the ancient world. The Olympic Games took place here every four years from 776 BC to 393 AD. The site was also a place of worship dedicated to the Greek god Zeus from about the 10th century BC.'),(155,'Patras','Greece','Greek','Patras is Greece\'s third-largest city and the regional capital of Western Greece, in the northern Peloponnese, 215 km west of Athens. The city is built at the foot of Mount Panachaikon, overlooking the Gulf of Patras.'),(156,'Scottish Highlands','Scotland','English','The Scottish Highlands are a mountainous region encompassing northwest Scotland. Loch Ness is at the centre, overlooked by the ruins of medieval Urquhart Castle and known for mythical monster “Nessie”. Northeast, near the city of Inverness, dolphins swim in the Moray Firth. Southwest, in the Western Highlands, trails wind up Ben Nevis, the U.K.’s highest peak, and red deer roam Glencoe valley with its waterfalls.'),(157,'Culloden','Scotland','English','Culloden is the name of a village three miles east of Inverness, Scotland and the surrounding area. 3 mi east of the village is Drumossie Moor, site of the Battle of Culloden.'),(158,'Isle of Skye','Scotland','English','The Isle of Skye, connected to Scotland\'s northwest coast by bridge, is known for its rugged landscapes, picturesque fishing villages and medieval castles. The largest island in the Inner Hebrides archipelago, it has an indented coastline of peninsulas and narrow lochs, radiating out from a mountainous interior. The town of Portree, a base for exploring the island, features harbourside pubs and boutiques. '),(159,'Stirling','Scotland','English','Stirling is a city in central Scotland. At the heart of its old town, medieval Stirling Castle is on a craggy volcanic rock. On the Abbey Craig outcrop, the National Wallace Monument is a 19th-century tower. It overlooks the site of the 1297 Battle of Stirling Bridge, where William Wallace defeated the English. The Battle of Bannockburn Experience has interactive 3D displays on the history of the 1314 conflict. '),(160,'Orkney Islands','Scotland','English','Orkney is an archipelago off the northeastern coast of Scotland. The islands encompass Neolithic sites, tall sandstone cliffs and seal colonies. The \'Heart of Neolithic Orkney\' is a group of 5,000-year-old sites on Mainland, the largest island including Skara Brae, a preserved village with a reconstructed house, and Maeshowe, a chambered burial tomb incorporating 12th-century Viking carvings.'),(161,'Galway','Ireland','Irish','Galway, a harbour city on Ireland’s west coast, sits where the River Corrib meets the Atlantic Ocean. The city’s hub is 18th-century Eyre Square, a popular meeting spot surrounded by shops and traditional pubs that often offer live Irish folk music. Nearby, stone-clad cafes, boutiques and art galleries line the winding lanes of the Latin Quarter, which retains portions of the medieval city walls.'),(162,'Aran Islands','Ireland','Irish','The Aran Islands are 3 rocky isles guarding the mouth of Galway Bay, in western Ireland. They’re known for their ancient sites. The largest island, Inishmore, is home to the prehistoric fort of Dún Aonghasa, perched on top of a high cliff. Nearby is the Worm Hole, a rectangular natural pool. The medieval ruins of the Seven Churches are in the northwest. Clochán na Carraige is a stone structure with a beehive roof.'),(165,'Interlaken','Switzerland','German','Interlaken is a traditional resort town in the mountainous Bernese Oberland region of central Switzerland. Built on a narrow stretch of valley, between the emerald-colored waters of Lake Thun and Lake Brienz, it has old timber houses and parkland on either side of the Aare River. Its surrounding mountains, with dense forests, alpine meadows and glaciers, has numerous hiking and skiing trails.'),(166,'St. Moritz ','Switzerland','German','St. Moritz is a luxury alpine resort town in Switzerland’s Engadin valley. It has hosted the Winter Olympics twice, has the Cresta Run, a world-championship bobsled run made of natural ice, and an outdoor Olympic ice rink. Its frozen lake hosts polo, cricket and even horse racing on ice. Ski and snowboard areas include Corviglia, Diavolezza and Corvatsch, and there are well-groomed cross-country ski trails.'),(167,'Seefeld','Austria','German','Seefeld is an Alpine town in the Austrian state of Tyrol. It lies on a plateau ringed by the Wetterstein and Karwendel ranges and is known for its cross-country skiing. The 1600s Seekirchl is a small baroque church with an onion dome. Frescoes in the Gothic St. Oswald church recount a miracle that reputedly occurred within. From there, a path leads to a hilltop circle of 12 massive stones representing the apostles. '),(168,'Padova','Italy','Italian','Padua is a city in Northern Italy’s Veneto region. It’s known for the frescoes by Giotto in its Scrovegni Chapel from 1303–05 and the vast 13th-century Basilica of St. Anthony. The basilica, with its Byzantine-style domes and notable artworks, contains the namesake saint’s tomb. In Padua\'s old town are arcaded streets and stylish cafes frequented by students of the University of Padua, established in 1222.'),(169,'Arezzo','Italy','Italian','Arezzo is a city in eastern Tuscany, Italy. The hilltop Arezzo Cathedral features painted vaulted ceilings and a 15th-century fresco of Mary Magdalene by Piero della Francesca. Nearby, the Basilica di San Francesco has a chapel decorated with more Piero frescoes. The Basilica di San Domenico contains the 13th-century “Crucifix” painted by Cimabue. The imposing Medicean Fortress has sweeping city views. '),(170,'Manchester ','United Kingdom','English','Manchester is a major city in the northwest of England with a rich industrial heritage. The Castlefield conservation area’s 18th-century canal system recalls the city’s days as a textile powerhouse, and visitors can trace this history at the interactive Museum of Science & Industry. The revitalised Salford Quays dockyards now house the Daniel Libeskind-designed Imperial War Museum North and the Lowry cultural centre.'),(171,'Zurich ','Switzerland','German ','The city of Zurich, a global center for banking and finance, lies at the north end of Lake Zurich in northern Switzerland. The picturesque lanes of the central Altstadt (Old Town), on either side of the Limmat River, reflect its pre-medieval history. Waterfront promenades like the Limmatquai follow the river toward the 17th-century Rathaus (town hall).'),(172,'Stockholm','Sweden','Swedish','Stockholm, the capital of Sweden, encompasses 14 islands and more than 50 bridges on an extensive Baltic Sea archipelago. The cobblestone streets and ochre-colored buildings of Gamla Stan (the old town) are home to the 13th-century Storkyrkan Cathedral, the Kungliga Slottet Royal Palace and the Nobel Museum, which focuses on the Nobel Prize. Ferries and sightseeing boats shuttle passengers between the islands.'),(173,'Zagreb','Croatia','Croatian','Zagreb, Croatia’s northwestern capital, is distinguished by its 18th- and 19th-century Austro-Hungarian architecture. At its center, Upper Town is the site of the Gothic, twin-spired Zagreb Cathedral and 13th-century St. Mark’s Church, with a colorfully tiled roof. Nearby is pedestrian-friendly Tkalčićeva Street, lined with outdoor cafes. Lower Town has the main square, Ban Jelačić, plus shops, museums and parks.'),(174,'Split','Croatia','Croatian','Split is the second-largest city of Croatia, the largest city in Dalmatia and the largest city on the Croatian coast. It lies on the eastern shore of the Adriatic Sea and is spread over a central peninsula and its surroundings.'),(175,'Dubrovnik','Croatia','Croatian','Dubrovnik is a city in southern Croatia fronting the Adriatic Sea. It\'s known for its distinctive Old Town, encircled with massive stone walls completed in the 16th century. Its well-preserved buildings range from baroque St. Blaise Church to Renaissance Sponza Palace and Gothic Rector’s Palace, now a history museum. Paved with limestone, the pedestrianized Stradun (or Placa) is lined with shops and restaurants.'),(176,'Warsaw','Poland','Polish','Warsaw, officially the Capital City of Warsaw, is the capital and largest city of Poland.'),(177,'Krakow','Poland','Polish','Krakow, a southern Poland city near the border of the Czech Republic, is known for its well-preserved medieval core and Jewish quarter. Its old town – ringed by Planty Park and remnants of the city’s medieval walls – is centered on the stately, expansive Rynek Glówny (market square). This plaza is the site of the Cloth Hall, a Renaissance-era trading outpost, and St. Mary’s Basilica, a 14th-century Gothic church.'),(178,'Gyor ','Hungary','Hungarian','Győr is the main city of northwest Hungary, the capital of Győr-Moson-Sopron County and Western Transdanubia region, and – halfway between Budapest and Vienna – situated on one of the important roads of Central Europe. It is the sixth largest city in Hungary, and one of its seven main regional centres.'),(179,'Belfast ','Ireland','Irish','Belfast is Northern Ireland’s capital. It was the birthplace of the RMS Titanic, which famously struck an iceberg and sunk in 1912. This legacy is recalled in the renovated dockyards\' Titanic Quarter, which includes the Titanic Belfast, an aluminium-clad museum reminiscent of a ship’s hull, as well as shipbuilder Harland & Wolff’s Drawing Offices and the Titanic Slipways, which now host open-air concerts.'),(180,'Leysin','Switzerland','German ','Leysin is a municipality of the canton of Vaud in the Aigle district of Switzerland. It is first mentioned around 1231–32 as Leissins, in 1352 as Leisins. Located in the Vaud Alps, Leysin is a sunny alpine resort village at the eastern end of Lake Geneva in proximity to Montreux, Lausanne, and Geneva. '),(181,'Engelberg','Switzerland','German ','Engelberg is an alpine town in central Switzerland. In the center is Kloster Engelberg, a 12th-century monastery. Trails weave up Mt. Titlis, and ski runs zigzag down, while revolving Titlis Rotair gondola lift leads to the summit, Titlis Cliff Walk suspension bridge and a glacial park. Trübsee, a glacial lake, lies nearby. Northeast, Rigidalstock mountain\'s steep face is lined with via ferratas (climbing ladders).'),(182,'Perugia','Italy','Italian','Perugia is an Italian city and the capital of the Umbria region. It’s known for its defensive walls around the historic center. The medieval Priori Palace exhibits regional art from the 13th century onward. Looking onto Piazza IV Novembre, the Gothic cathedral houses Renaissance paintings and frescoes. In the square\'s center, Fontana Maggiore is a marble fountain with carvings of biblical scenes and zodiac signs. '),(183,'Florence','Italy','Italian','Florence, capital of Italy’s Tuscany region, is home to many masterpieces of Renaissance art and architecture. One of its most iconic sights is the Duomo, a cathedral with a terracotta-tiled dome engineered by Brunelleschi and a bell tower by Giotto. The Galleria dell\'Accademia displays Michelangelo’s “David” sculpture. The Uffizi Gallery exhibits Botticelli’s “The Birth of Venus” and da Vinci’s “Annunciation.”'),(184,'Siena','Italy','Italian','Siena, a city in central Italy’s Tuscany region, is distinguished by its medieval brick buildings. The fan-shaped central square, Piazza del Campo, is the site of the Palazzo Pubblico, the Gothic town hall, and Torre del Mangia, a slender 14th-century tower with sweeping views from its distinctive white crown. The city’s 17 historic “contrade” (districts) extend outward from the piazza.'),(185,'Eindhoven ','Netherlands','Dutch','Eindhoven is a city in the province of North Brabant in the south Netherlands. Known as a technology and design hub, it’s the birthplace of Philips electronics, which built the Philips Stadium, home to the PSV soccer team. The Philips Museum traces the company\'s design history. Nearby, the Van Abbemuseum focuses on art and design. Northwest, the former industrial complex Strijp-S houses design shops and restaurants. '),(186,'Mendrisio','Switzerland','German ','Mendrisio is a municipality in the district of Mendrisio in the canton of Ticino in Switzerland. Mendrisio is the seat of the Accademia di Architettura of the university of Italian-speaking Switzerland. The municipality was boosted in size on 4 April 2004 when it incorporated the former municipality of Salorino.'),(187,'Naxos','Greece','Greek','Naxos is a Greek island in the South Aegean, the largest of the Cyclades island group. Its fertile landscape spans mountain villages, ancient ruins and long stretches of beach. The namesake capital (also called Hora or Chora) is a port town filled with whitewashed, cube-shaped houses and medieval Venetian mansions. Kastro, a hilltop castle dating to the 13th century, houses an archaeological museum.'),(188,'Paros','Greece','Greek','Paros is a Greek island in the Aegean Sea best known for its beaches and traditional villages. Parikia, the bayside capital, is a boating and transportation hub for the Cyclades region. It\'s also home to the Panagia Ekatontapiliani, a landmark Byzantine church from the 4th century A.D. The north coast\'s Kolimbithres is a beach where naturally sculpted rocks form swimming coves'),(189,'Occhiobello ','Italy','Italian','Occhiobello is a comune in the Province of Rovigo in the Italian region Veneto, located about 80 kilometres southwest of Venice and about 25 kilometres southwest of Rovigo'),(190,'Helsinki','Finland','Finnish ','Helsinki, Finland’s southern capital, sits on a peninsula in the Gulf of Finland. Its central avenue, Mannerheimintie, is flanked by institutions including the National Museum, tracing Finnish history from the Stone Age to the present. Also on Mannerheimintie are the imposing Parliament House and Kiasma, a contemporary art museum. Ornate red-brick Uspenski Cathedral overlooks a harbor. '),(191,'Oslo','Norway','Norwegian ','Oslo, the capital of Norway, sits on the country’s southern coast at the head of the Oslofjord. It’s known for its green spaces and museums. Many of these are on the Bygdøy Peninsula, including the waterside Norwegian Maritime Museum and the Viking Ship Museum, with Viking ships from the 9th century. The Holmenkollbakken is a ski-jumping hill with panoramic views of the fjord. It also has a ski museum.'),(192,'Geilo','Norway','Norwegian ','Geilo is a town in southern Norway known for ski resorts and mountain trails. It’s a gateway to 2 national parks. The nearest, Hallingskarvet National Park, is characterized by steep cliffs and shelters arctic foxes. A trail climbs to a cabin built by Norwegian philosopher Arne Næss. Southwest of town, the vast Hardangervidda National Park, with its massive plateau, has wild reindeer herds and many lakes and rivers'),(193,'Sicily',' the well-preserved ruins of 7 monumental',' Doric-style Greek temples','Sicily, the largest Mediterranean island, is just off the \"toe\"\" of Italy\'s \"\"boot.\"\" Its rich history is reflected in sites like the Valley of the Temples'),(194,'Valencia','Spain','Spanish','The port city of Valencia lies on Spain’s southeastern coast, where the Turia River meets the Mediterranean Sea. It’s known for its City of Arts and Sciences, with futuristic structures including a planetarium, an oceanarium and an interactive museum. Valencia also has several beaches, including some within nearby Albufera Park, a wetlands reserve with a lake and walking trails.'),(195,'Frankfurt ','Germany','German','Frankfurt, a central German city on the river Main, is a major financial hub that\'s home to the European Central Bank. It\'s the birthplace of famed writer Johann Wolfgang von Goethe, whose former home is now the Goethe House Museum. Like much of the city, it was damaged during World War II and later rebuilt. The reconstructed Altstadt (Old Town) is the site of Römerberg, a square that hosts an annual Christmas market.'),(196,'Granada ','Spain','Spanish','Granada is a city in southern Spain’s Andalusia region, in the foothills of the Sierra Nevada mountains. It\'s known for grand examples of medieval architecture dating to the Moorish occupation, especially the Alhambra. This sprawling hilltop fortress complex encompasses royal palaces, serene patios, and reflecting pools from the Nasrid dynasty, as well as the fountains and orchards of the Generalife gardens.'),(198,'Meiringen','Switzerland','German ','Meiringen is a municipality in the Interlaken-Oberhasli administrative district in the canton of Bern in Switzerland. Besides the village of Meiringen, the municipality includes the settlements of Balm, Brünigen, Eisenbolgen, Hausen, Prasti, Sand, Stein, Unterbach, Unterheidon, Wylerli and Zaun.'),(199,'Ticino','Switzerland','Italian','Ticino is an Italian-speaking region in southern Switzerland with palm-lined lakes and sharp Alpine peaks. Its architecture, cuisine and culture is closely related to that of neighboring Italy. Bellinzona, the capital of Ticino, is home to medieval castles. Lugano, a town on glacial Lake Lugano, is known for its waterfront promenade and Piazza della Riforma, a square lined with neoclassical buildings.'),(200,'Salerno','Italy','Italian','Salerno is a port city southeast of Naples, in Italy. Atop Monte Bonadies, the centuries-old Arechi Castle has sea views, plus Museo Medievale del Castello, exhibiting medieval ceramics and coins. In town, built on the ruins of a Roman temple, is Salerno Cathedral. It has Byzantine bronze doors, a baroque crypt and a marble altar. The terraced Minerva’s Garden has been growing medicinal plants since the 14th century. '),(201,'Lille','Paris','French','Lille is the capital of the Hauts-de-France region in northern France, near the border with Belgium. A cultural hub and bustling university city today, it was once an important merchant center of French Flanders, and many Flemish influences remain. The historic center, Vieux Lille, is characterized by 17th-century brick town houses, cobbled pedestrian streets and the large central square, Grand Place. '),(202,'Arras','Paris','French','Arras is a city in northern France. The Carrière Wellington is a network of quarry tunnels used by soldiers during WWI. North of the city, surrounded by lush countryside, the Canadian National Vimy Memorial honors the Canadian soldiers killed during the war. In town, the cobbled Place des Héros has buildings with Flemish facades, including the Town Hall and belfry. The Abbey of St. Vaast houses a fine arts museum. '),(203,'Αmiens','Paris','French','Amiens is a city in northern France, divided by the Somme river. It’s known for the Gothic Amiens Cathedral and nearby medieval belfry. Shops and cafes line the Quartier St.-Leu’s narrow streets. Floating market gardens (“hortillonnages”) dot the city’s canals. The Musée de Picardie shows art and antiquities spanning centuries. Nearby, the Maison de Jules Verne is a museum where the science fiction author once lived'),(204,'Chantilly ','Paris','French','Chantilly is a commune in the Oise department in the Valley of the Nonette in the Hauts-de-France region of Northern France. Surrounded by Chantilly Forest, the town of 10,863 inhabitants falls within the metropolitan area of Paris.'),(205,'Vicenza','Italy','Italian','Vicenza is a city in the Veneto region of northeast Italy. It’s known for the elegant buildings designed by the 16th-century architect Andrea Palladio. These include the Palladian Basilica and the Palazzo Chiericati, now home to an art gallery. Nearby, also by Palladio, the Teatro Olimpico replicates a classic outdoor theater, indoors. On the outskirts of town, the hilltop Villa La Rotonda has 4 identical facades.'),(206,'Munich','Germany','German','Munich, Bavaria’s capital, is home to centuries-old buildings and numerous museums. The city is known for its annual Oktoberfest celebration and its beer halls, including the famed Hofbräuhaus, founded in 1589. In the Altstadt (Old Town), central Marienplatz square contains landmarks such as Neo-Gothic Neues Rathaus (town hall), with a popular glockenspiel show that chimes and reenacts stories from the 16th century.'),(207,'Bordeaux','Paris','French','Bordeaux, hub of the famed wine-growing region, is a port city on the Garonne River in southwestern France. It’s known for its Gothic Cathédrale Saint-André, 18th- to 19th-century mansions and notable art museums such as the Musée des Beaux-Arts de Bordeaux. Public gardens line the curving river quays. The grand Place de la Bourse, centered on the Three Graces fountain, overlooks the Miroir d’Eau reflecting pool.'),(208,'Toulouse ','Paris','French','Toulouse, capital of France’s southern Occitanie region, is bisected by the Garonne River and sits near the Spanish border. It’s known as La Ville Rose (‘The Pink City’) due to the terra-cotta bricks used in many of its buildings. Its 17th-century Canal du Midi links the Garonne to the Mediterranean Sea, and can be traveled by boat, bike or on foot. '),(209,'Marseille','Paris','French','Marseille, a port city in southern France, has been a crossroads of immigration and trade since its founding by the Greeks circa 600 B.C. At its heart is the Vieux-Port (Old Port), where fishmongers sell their catch along the boat-lined quay. Basilique Notre-Dame-de-la-Garde is a Romanesque-Byzantine church. Modern landmarks include Le Corbusier’s influential Cité Radieuse complex and Zaha Hadid’s CMA CGM Tower. '),(210,'Sion ','Switzerland','German ','Sion is a city in the southwestern Swiss canton of Valais. It’s known for 2 hilltop fortifications: the 13th-century Tourbillon Castle ruins and the Valère Castle complex, with a basilica housing an organ over 500 years old. The 15th-century Cathedral of Notre-Dame-du-Glarier and the conical Witches’ Tower are in the old town. The Majorie and Vidomnat towers house the Valais Art Museum’s regional art collection.'),(211,'Bergen','Norway','Norwegian ','Bergen is a city on Norway’s southwestern coast. It\'s surrounded by mountains and fjords, including Sognefjord, the country’s longest and deepest. Bryggen features colorful wooden houses on the old wharf, once a center of the Hanseatic League\'s trading empire. The Fløibanen Funicular goes up Fløyen Mountain for panoramic views and hiking trails. The Edvard Grieg House is where the renowned composer once lived. '),(212,'Kristiansand','Norway','Norwegian ','Kristiansand is a city in southern Norway. Its old town, Posebyen, features traditional wooden houses. In the center, neo-Gothic Kristiansand Cathedral is near the Sørlandets Museum, which displays Norwegian art from 1800 to today. The southeastern shoreline includes the Bystranda city beach, the 17th-century Christiansholm Fortress rotunda and Fiskebrygga quay, lined with fishmongers selling their catch'),(213,'Glencoe','Scotland','English','Glencoe is a village in western Scotland. It lies in steep-sided Glencoe valley, in the Scottish Highlands. The area is known for waterfalls and trails that climb peaks such as Buachaille Etive Mor and Bidean nam Bian. In the village, Glencoe Folk Museum occupies 18th-century thatched cottages, with displays on local heritage and the Glencoe massacre of 1692. Wildlife in the area includes red deer and golden eagles.');
