INSERT INTO `travel_guide` VALUES ('Certified tour guide responsible for showing visitors around and explaining the significance of various buildings and landmarks. Gives tours to children and their families.\r\nPerformed research to better understand different attractions and to relay information in a clear manner.\r\nGreeted visitors and maintained a friendly disposition when answering questions about various sights of interest.\r\nOrganized seasonal tours to parks and recreation centers.\r\nEnforced rules of safety and made accommodations for disabled visitors.\r\nChecked regularly to ensure that children did not wander away from group.\r\nPerformed first aid and CPR and contacted police or paramedics in emergency situations',182),('Organized and facilitated travel to multiple destinations including Europe, Asia, and North America. Partnered with local luxury concierge services to deliver guided tours for groups and individual travelers.\r\nDelivered highly engaging conversations with tourists to communicate the history, building structures, local culture, wildlife, and economics of each area while facilitating tours to sites across the city.\r\nManaged unforeseen circumstances by adjusting tours while effectively articulating with customers.\r\nPromoted business on social media, colleges, and businesses, and local events.\r',183),('Licensed and credentialed tour guide with knowledge of landmarks, museums, restaurants, streets, and other places of interest. Possesses class B license for driving and operating tour bus.\r\nProvided information and insights to tourists and sightseers to entertain and pass on knowledge about areas of interest.\r\nOrganized and scheduled tours for different times of the day.\r\nAnswered questions related to attractions patiently and thoughtfully.\r\nScheduled tours inside of museums and facilities with permission of building managers.\r\nDrove groups of tourists around in tour bus while describing streets and buildings over an intercom.\r\nMade accommodations for elderly and disabled tourists.\r',184),('Lead tour groups and ensured that all needs of clients are addressed.\nEnsured safety of clients and assisted in the implementation of security measures in the venue.\nPrepared tour guide documents\nDeveloped program itineraries depending on the needs of clients.\nDeveloped promotional materials to be distributed to clients.\nPromoted and pushed the sales of souvenirs and trail guidebooks.',185),('Ensured safekeeping and enjoyment of visitors within the property.\r\nEnsured that visitors are treated with utmost courtesy with all members of the team.\r\nLead interesting tours to various groups.\r\nAssisted with the security of the venue and ensured safety of audience.\r\nLiaised with other members of the team to determine audience feedback.\r\nOrganized activities and team building exercises for children and adults.',186),('Ability to manage multiple tasks\r\nSelf-motivated team player with excellent communication skills\r\nHas the confidence to speak to different, multi-cultural groups\r\nAbility to understand client’s needs\r\nWide experience in customer service and travel\r\nCan work well under pressure.',187),('Led guided tours and informational talks for groups of 35-60 tourists on 3-7 hour tours to natural highlights.\r\nEducated and shared natural, geological, and cultural history through story-telling, and narrated bus rides to enable an emotional connection with their visit.\r\nCoordinated food programs for guests (60-100) including phone orders, report submission, food distribution and alternate action plans.\r\nCommunication with the office regarding visitor safety, to submission of timesheets, and front line representative for the public.\r\nResearched and studied the language, culture, geography, natural and social history.\r\nConnect visitors to the complexities of consequence and difficult balance of culture and international relations.\r\nCreated personalized and seasonal tour experiences to feature eco-responsible animal sightings including humpback whales and albatross migration.\r\nAssisted on vehicle maintenance for weekly car washes, interior detail-work for windows, rubbish pick up, etc.',188),('Prepared bowls, and fed and cleaned pens for over 150 farm and exotic animals.\r\nGave guided tours to several various sized groups of people throughout the day.\r\nMonitoring interaction with the animals, and educating people at an exotic animal petting zoo.\r\nResponsible for keeping grounds clean and free of weeds, keeping water bowls full, adhering to safety procedures, using several pieces of farm equipment and tools.\r\nSpending time with all the animals in order to get to know them, along with studying their behaviors and acquiring correct knowledge to pass on to my tour groups.\r\nHad a strong bond with many of these animals by the end of the season.\r\nResearched and obtained extensive knowledge of over 100 species of animals, and relayed this information to others in order to make their experience educational.\r\nVolunteered many hours as well during the days off and after the shifts.\r',189),('Maintain a fun and safe environment to customers and families during a video tour in the warehouse facility.\r\nCheerfully greeted each customer and properly seated them on the train.\r\nRoutinely checked all seat belts and carts for safety according to the company\'s standards.\r\nAnnounce warehouse regulations and safety rules before dispatching and answering customer\'s questions and concerns about the ride, company\'s candy production and/ or history.\r\nDirected the crowd to exits and handed a free sample.\r\nHelped around the store, cooked and prepped food at the cafe, and provided great customer service at the registers.\r\nVisiting major cities, national parks and small-town to provide passengers with a unique cultural experience similar to the road trip.\r',190),('Provided a dynamic, informative and entertaining behind-the-scenes tour.\r\nDelivered greater product awareness for our consumers by responsibly serving beverages in the hospitality room, both after hours and during special events.\r\nMaking successful recommendations to guests based on their individual tastes.\r\nExecuted friendly, efficient, and helpful retail and customer service in the gift shop, by anticipating their needs.\r\nDeveloped upstanding, well-versed tour guides by mentoring and training my newer peers to the organization.\r\nHelp clients to learn, keep or improve skills and functional abilities that they may not be developing normally.\r\nCreates and maintains positive emotional states through the course of each day for clients.\r',191),('Responsible for safety and well-being of groups consisting of 25-30 people containing families and persons of all ages.\nFacilitated educational and informative tours to inform customers about the rich history that shaped the city.\nMonitored visitors\' activities to ensure compliance with establishment and tour regulations and safety practices.\nResearched various topics, including site history, environmental conditions, and clients\' skills and abilities to plan appropriate expeditions, instruction, and commentary.\nIntegrated electrical and mechanical systems to produce the desired function.\nTalking to others to convey information effectively, such as meeting, due dates, and time-sensitive information.\nCreates and maintains positive emotional states through the course of each day for clients.',192),('Performed daily operational duties such as following opening and closing procedures, sold tickets and gift shop merchandise.\r\nGuided children and adults throughout the museum.\r\nGreeted guests entering the museum to ascertain customer needs.\r\nEarned management\'s confidence with the issuance of company keys by responsibly opening and closing store.\r\nPrepared and explained new membership contracts.\r\nHandling customer inquiries and account issues smoothly and accurately, ensuring customer satisfaction.\r\nConsistently upsold products and motivated customers to upgrade current product plans, receiving monthly recognition for high numbers.\r',193),('Recommended merchandise based on customer needs.\r\nDisplayed strong public speaking skills and communication abilities to ensure the highest quality tour for guests of the cavern.\r\nAble to maintain and clean a store as necessary, including mopping, sweeping, and organizing merchandise.\r\nShared product knowledge with customers while making personal recommendations.\r\nDemonstrated that customers come first by serving them with a sense of urgency.\r\nDemonstrated crowd control capabilities and strong leadership role.\r\nWork with individual team members to quickly come up with creative solutions to diverse problems.\r',194),('Describe tour points of interest to group members, and respond to questions.\r\nGreet and register visitors, and issue any required identification badges or safety devices.\r\nDistribute brochures, show audiovisual presentations, and explain establishment processes and operations at tour sites.\r\nResearch various topics, including site history, environmental conditions, and clients\' skills and abilities to plan appropriate expeditions, instruction, and commentary.\r\nAccommodated and entertained all guests with personalized tours, safety instructions, and flexibility.\r\nSolicit tour patronage and sell souvenirs.\r\nClean objects, such as paper, textiles, wood, metal, glass, rock, pottery, and furniture, using cleansers, solvents, soap solutions, and polishes.\r\nInstall, arrange, assemble, and prepare artifacts for exhibition, ensuring the artifacts\' safety, reporting their status and condition.\r',195),('Describe tour points of interest to group members, and respond to questions.\nEscort individuals or groups on cruises, sightseeing tours, or through places of interest such as industrial establishments, public buildings, and art galleries.\nMonitor visitors\' activities to ensure compliance with establishment or tour regulations and safety practices.\nProvide directions and other pertinent information to visitors.\nGreet and register visitors, and issue any required identification badges or safety devices.\nDistribute brochures, show audiovisual presentations, and explain establishment processes and operations at tour sites.\nResearch various topics, including site history, environmental conditions, and clients\' skills and abilities to plan appropriate expeditions, instruction, and commentary.\nSelect travel routes and sites to be visited based on knowledge of specific areas.',196),('Captured stray animals, provided housing and care of homeless animals and coordinated adoptions.\r\nCleaned kennels, animal holding areas, examination, and operating rooms, and animal loading/unloading facilities.\r\nProvided emergency first aid to animals as needed.\r\nExamined animals to detect and determine the nature of diseases or injuries.\r\nCollected body tissue, feces, blood, urine or other body fluids for examination and analysis.\r\nTrained and socialized puppies including housetraining and ending destructive behaviors.\r\nEnsured public safety and upholding state and regional laws by working with local health departments, police, and other law enforcement agencies.\r\nBathed, trimmed and provided other grooming services for domestic pets.\r',197),('Researched and presented facts and historical information about the city with a sense of humor.\r\nProvided advice and directions to local restaurants, historical sites, and various destinations.\r\nLed groups of 5-60 people through historical areas while still maintaining authority and safety at all times.\r\nCoordinated with bus drivers, boat companies, restaurants, and multiple venues.\r\nEstablished personal relationships with guests while narrating one to three 11/2 to eight-hour tours a day.\r\nGuided guests during unexpected problems, such as city blackout.\r\nCommunicated with guests from different countries and of different ages.\r',198),('Describe tour points of interest to group members, and respond to questions.\nEscort individuals, public buildings, and art galleries.\nConduct educational activities for school children.\nMonitor visitors\' activities to ensure compliance with establishment or tour regulations and safety practices.\nProvide directions and other pertinent information to visitors.\nGreet and register visitors, and issue any required identification badges or safety devices.\nDistribute brochures, show audiovisual presentations.\nResearch various topics, including site history, environmental conditions, and clients\' skills and abilities to plan appropriate expeditions, instruction, and commentary.',199),('Resolved all customer complaints in a professional manner while prioritizing customer satisfaction.\r\nDetermined customer needs by asking relevant questions and listening actively to the responses.\r\nWorking and effectively communicating with very large, diverse groups of guests.\r\nPriced merchandise, stocked shelves and took inventory of supplies.\r\nLearned, retained, and presented large amounts of information.\r\nOperated a cash register for cash, check and credit card transactions with 100% accuracy.\r\nWalking, standing, and speaking for extended periods of time.\r\nWorking well alongside a team, as well as individually.\r\nAttended comprehensive training sessions, and participated in regional orientation conference.\r',200),('I am a highly experienced Tour Guide with over 3 years of experience leading both small and large groups through various tourist destinations. I have an in-depth knowledge of history, culture, and local customs which enhances the tour experience for my guests. My passion for people and customer service ensures that each guest feels special, welcomed, and excited about their adventure. I would love to bring my expertise to your company and provide travelers with unforgettable memories.',201),('Guided an average of 15 tours per month, totaling over 180 hours of tour guiding.\r\nLed groups of up to 40 people at a time through various tourist attractions.\r\nAnswered questions and provided information about the history, culture, and customs of the areas visited on tour.\r\nMade sure all members of the group stayed together and remained safe while on tour.\r\nHelped plan itineraries for future tours.',202),('Led groups of up to 30 people on tours of historic sites.\r\nAnswered questions and provided information about the sites to tour members.\r\nActed as a liaison between the tour company and clients.\r\nNegotiated with vendors for services.\r\nAssisted in planning itineraries.',203),('I am a professional tour guide with over three years of experience. I have worked in various capacities, including as a tour operator, travel agent, and customer service representative. I have an extensive knowledge of the tourism industry and am familiar with all aspects of planning and executing tours. In addition to my work experience, I also hold a degree in Tourism Management from XYZ University. I am an excellent communicator and thrive when working with people. I am able to manage large groups effectively and ensure that everyone has a positive experience. My organizational skills are superb, and I always pay close attention to detail to ensure that everything is taken care of before, during, and after each tour. Safety is always my top priority; however, I also know how to strike the perfect balance between fun and safety so that everyone enjoys themselves while still feeling secure under my watchful eye',204),('Led groups of up to 30 people on tours of local attractions.\r\nAnswered questions and provided information about the area to tour guests.\r\nMade sure all guests were comfortable and had a positive experience.\r\nHelped plan and organize group activities during their stay.',205),('Led groups of up to 30 people on tours of historic sites.\r\nAnswered questions and provided information about the tour site to visitors.\r\nTrained new tour guides in company policies and procedures.\r\nDeveloped a working knowledge of all aspects of the tour guide position.\r\nMaintained a professional attitude at all times while interacting with customers.',206),('I am an experienced and results-driven Tour Manager with over 8 years of experience overseeing tours, groups and events. I am adept in developing and implementing innovative strategies for tour operations and customer relations. My expertise in travel logistics, budget management, and team leadership have enabled me to successfully coordinate and manage a variety of tour and event activities. I have strong interpersonal skills and the ability to successfully collaborate with a diverse group of customers and stakeholders. I have a track record of success in providing exceptional customer service and ensuring that tours exceed customer expectations. I am passionate about creating a positive customer experience and strive to create lasting memories for each client.',207),('Negotiated a 15% increase in artist\'s performance fee.\r\nSuccessfully coordinated travel and lodging for a 10-person entourage.\r\nCreated an efficient daily schedule for the artist that accounted for all media appearances, rehearsals, and performances.\r\nWorked closely with venue staff to ensure smooth production of shows.\r\nActed as liaison between artist and label/management.',208),('Successfully coordinated and managed tours for 3 different bands, accommodating schedules and logistics for up to 15 people.\r\nCreated detailed itineraries for each tour, including travel, accommodation, performance and media appearances.\r\nManaged budgets of up to $50 000 per tour, ensuring all expenses were tracked and accounted for.\r\nCommunicated regularly with venue managers and promoters to ensure smooth running of shows.\r\nActed as a liaison between the band and crew, ensuring everyone was aware of their roles and responsibilities.',209),('Led tours for groups of up to 30 people.\r\nDesigned and created tour itineraries.\r\nWrote grants totaling $10,000 to fund educational programming.\r\nTrained new tour guides in customer service and public speaking techniques.\r\nResearched and wrote interpretive materials used on tours.',210),('I am a Tour Manager with 8+ years of experience in the travel and hospitality industry. I have extensive knowledge of the industry and a great understanding of customer service and sales. I am highly organized and detail-oriented, and able to efficiently manage tour groups of all sizes. I have excellent communication skills and am skilled at resolving customer complaints. Additionally, I am adept at researching tour destinations, organizing itineraries, and managing budgets. I am committed to providing an enjoyable and memorable experience for every group I manage.',211),('Successfully coordinated and managed national and international tours for bands, artists, and other performers.\r\nManaged logistics for transportation, accommodation, venues, and crew for tours.\r\nNegotiated contracts with agents, promoters, venue managers, and others involved in tour planning.\r\nEnsured that all aspects of the tour ran smoothly and according to schedule.\r\nMaintained a positive relationship with all members of the touring party (band/artist) while on the road.',212),('Successfully managed and operated tour for artist, including managing all logistics such as booking transportation and hotels, coordinating schedules, and overseeing crew.\r\nEnsured that the artist was happy and comfortable throughout the tour by taking care of any needs or requests they had.\r\nKept track of expenses for the tour and stayed within budget.\r\nMade sure that each show went smoothly by running sound checks and dealing with any problems that arose backstage.',213),('Led groups of up to 30 people on tours of various locations.\r\nAnswered questions and provided information about the tour location to guests.\r\nMade sure all guests were accounted for and safe at all times during the tour.\r\nManaged bookings and reservations for tours.\r\nCoordinated with other staff members to ensure smooth operation of tours.',214),('I am a Tour Coordinator with over three years of experience. I have coordinated tours for groups of all sizes, both domestic and international. I am well-versed in the planning and execution of successful tour itineraries. I have a keen eye for detail and take pride in my work. I thrive in fast-paced environments and enjoy working with people from all walks of life.',215),('Successfully coordinated and executed 15 tours with an average of 30 attendees per tour.\r\nWorked closely with clients to ensure all their needs were met before, during, and after the tour.\r\nCreated informative materials such as itineraries, maps, and activity schedules for each tour.\r\nOversaw a team of 5 junior coordinators and provided guidance when needed.\r\nResolved any issues that arose during the tours in a timely manner.\r\nMaintained positive relationships with vendors.',216),('Successfully coordinated and managed tours for 15,000 visitors annually.\r\nCultivated relationships with key partners, resulting in increased bookings by 20%.\r\nStreamlined operations and reduced costs by 10%.\r\nImplemented new customer service initiatives that improved satisfaction ratings by 15%.\r\nDesigned and executed promotional campaigns that boosted ticket sales by 25%.\r\nManaged a team of 12 tour guides while maintaining high levels of productivity.',217),('I am a Tour Coordinator with over 3 years of experience in the industry. I have coordinated tours for groups of all sizes, both domestic and international. I am extremely organized and detail-oriented, which has allowed me to successfully plan and execute a variety of different types of tours. I possess excellent customer service skills and enjoy working closely with clients to ensure that their needs are met. In addition, I have strong interpersonal skills and work well within a team environment.',218),('Delivered successful tours for groups of up to 100 people, managing all logistics including transportation, accommodation, and activities.\r\nIncreased tour bookings by 20% through effective marketing and promotion.\r\nNegotiated discounts with suppliers which saved an average of 10% per tour.\r\nWrote clear and concise reports detailing tour itineraries, budgets, and outcomes.',219),('Successfully coordinated and executed travel plans for a group of 100 people.\r\nSuccessfully managed a budget of $10,000.\r\nCreated an itinerary that saved the company 20% in overall costs.\r\nNegotiated with vendors to secure discounts on transportation and lodging for a group of 200 people.\r\nWas able to get hotel rooms upgraded for VIP clients at no additional cost.\r\nWorked closely with the sales team to coordinate travel for client meetings which resulted in 5 new accounts being brought on.',220),('Greeted all guests promptly at scheduled tour times.Provided excellent service to guests, including maintaining general knowledge of park attractions and amenities, answering questions, and finding ways to create a great guest experience, in accordance with the standards of guest service.Helped answer questions at the tours and welcome desk.',221),('I have extensive experience in leading tours. I have worked as a tour guide for the past two years at the Historical Museum, and I have also worked as a guide for the past four years at a local history museum. I am knowledgeable about a wide range of historical topics and I am comfortable speaking in public. I am also proficient in using audio-visual technology to enhance my presentations.\r\n\r\nI am passionate about history and I am excited to share my knowledge with visitors to the Historical Museum. I am confident that I have the skills and experience to be a valuable member of your team.',222),('I have been a Tour Guide for the past three years, and during that time I have developed a strong passion for the job. I love interacting with people and sharing my knowledge of the city with them. I am also very detail-oriented and I take pride in providing a high level of customer service.\nI have a strong track record of success in this field, and I have consistently exceeded the expectations of my employers. I have a deep knowledge of the city and I am confident in my ability to provide an enjoyable and informative tour for my guests. I am also proficient in using various technologies such as GPS and online mapping tools.',223);
